import React from 'react';

const ChartCard = () => {
  return (
    <div className="bg-[#1E293B] rounded-lg shadow-lg p-6 h-full">
      <h2 className="text-xl font-semibold mb-4">Chart Card</h2>
      <p className="text-gray-400">Chart Card component placeholder.</p>
    </div>
  );
};

export default ChartCard;
